import React, { Component } from "react";
import "./stars.js";

class Starfield extends Component {
  constructor(props) {
    super(props);
  }

  componentDidMount () {
    const script = document.createElement("script");
    script.src = "/stars.js";
    script.async = true;
    document.body.appendChild(script);
  }

  render() {
    return (
      <div class="starfield">
        <canvas id="starField"></canvas>
      </div>
    );
  }
}

export default Starfield()
